import React from "react";
import Form from "./Form";

const header = props => {
  return (
    <div>
      <div className="nav-container">
        <h1>{props.title}</h1>

        <Form className="forms" text={props.text} username={props.username}/>
      </div>
    </div>
  );
};

export default header
